import Vue from 'vue'
import App from './App.vue'
//引入store
import Store from "./store/index"

//关闭Vue的生产提示
Vue.config.productionTip = false;

//创建vm
new Vue({
  el: "#app",
  render: h => h(App),
  Store,
  beforeCreate() {
    Vue.prototype.$bus = this
  }
})
